class Solution:
    prev_left = -1
    prev_right = -1
    nchars_needed = -1
    chars = None
    orig_chars = None

    def set_chars(self, remove_status, c):
        if remove_status:
            if self.chars[c] > 0:
                self.nchars_needed -= 1
            self.chars[c] -= 1
        else:
            if self.chars[c] < self.orig_chars[c] and self.chars[c] >= 0:
                self.nchars_needed += 1
            self.chars[c] += 1

    def valid_str(self, left, right):
        if self.prev_left != -1:
            # print(self.chars)
            # count the additional chars
            if self.prev_left > left:
                for i in range(left, self.prev_left):
                    c = self.s[self.charsLocList[i]]
                    # print("l1", c)
                    self.set_chars(True, c)
            # remove the chars not to be counted
            elif self.prev_left < left:
                for i in range(self.prev_left, left):
                    c = self.s[self.charsLocList[i]]
                    # print("l2", c)
                    self.set_chars(False, c)

            # count the additional chars
            if self.prev_right < right:
                for i in range(self.prev_right+1, right+1):
                    c = self.s[self.charsLocList[i]]
                    # print("r1", c)
                    self.set_chars(True, c)
            # remove the chars not to be counted
            if self.prev_right > right:
                for i in range(right + 1, self.prev_right + 1):
                    c = self.s[self.charsLocList[i]]
                    # print("r2", c)
                    self.set_chars(False, c)
            # print(self.chars)
            # print(self.nchars_needed)
        else:
            chars = {}
            nchars_needed = len(self.t)
            for c in self.t:
                if c not in chars:
                    chars[c] = 0
                chars[c] += 1
            self.chars = chars    
            self.nchars_needed = nchars_needed
            self.orig_chars = dict(chars)
            
            for i in range(left, right+1):
                c = self.s[self.charsLocList[i]]
                self.set_chars(True, c)

        self.prev_left = left
        self.prev_right = right

        if self.nchars_needed <= 0:
            return True
        return False

    def minWindow(self, s: str, t: str) -> str:
        if len(s) == 0:
            return ""
        self.s = s
        self.t = t
        charsNeeded = {}
        for c in t:
            if c not in charsNeeded:
                charsNeeded[c] = []

        charsLocList = []
        for i in range(len(s)):
            c = s[i]
            if c in charsNeeded:
                charsNeeded[c].append(i)
                charsLocList.append(i)

        self.charsLocList = charsLocList
        
        lefti = 0
        righti = 0

        minleft = -1
        minright = -1
        mindistance = len(s) + 1
        
        charsloclen = len(charsLocList)
        if charsloclen == 0:
            return ""

        result = self.valid_str(lefti, righti)
        if result:
            d = charsLocList[righti] - charsLocList[lefti]
            if d < mindistance:
                minleft = charsLocList[lefti]
                minright = charsLocList[lefti]
                mindistance = minright - minleft

        while True:
            while righti < charsloclen - 1:
                righti += 1
                result = self.valid_str(lefti, righti)
                # print("r")
                # print(s[charsLocList[lefti]:charsLocList[righti]+ 1], charsLocList[lefti], charsLocList[righti], result)
                if result:
                    d = charsLocList[righti] - charsLocList[lefti]
                    if d < mindistance:
                        minleft = charsLocList[lefti]
                        minright = charsLocList[righti]
                        mindistance = minright - minleft
                    break
            
            while lefti < charsloclen - 1:
                lefti += 1
                result = self.valid_str(lefti, righti)
                # print('l')
                # print(s[charsLocList[lefti]:charsLocList[righti]+ 1], charsLocList[lefti], charsLocList[righti], result)
                if result:
                    d = charsLocList[righti] - charsLocList[lefti]
                    if d < mindistance:
                        minleft = charsLocList[lefti]
                        minright = charsLocList[righti]
                        mindistance = minright - minleft
                else:
                    lefti -= 1
                    break
            
            if righti == charsloclen - 1:
                break
        
        # print(minleft, minright, mindistance)
        # print(self.valid_str(charsLocList, left, len(charsLocList)-1))
        return s[minleft:minright+ 1]
        
s = Solution()
print(s.minWindow("A", "b"))
print(s.minWindow("ADOBECODEBANC", "ABC"))

